import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
export default function AdminHome() {
  useEffect(() => {
    if (!localStorage.getItem('sur-uid')) navigate('/admin/login');
  });
  return <div>AdminHome</div>;
}
